import { Button, Image } from 'react-bootstrap';
import doctorImage from '../../../../src/images/5790-removebg.png';
import './doctor.css';

const Doctor = () => {
    return (
     <div className="container">
            <div style={{height:"29rem", backgroundColor:" #3A4256"}} className="row  d-flex">

       
<div  className="col-sm-6 doctorStyle">
    <Image  style={{height:"29rem"}} src={doctorImage} rounded></Image>

</div>
 <div style={{height:"400px", padding:"1rem"}} className="col-sm-6">
     <h3 style={{color:"#1cc7c1"}}>Appointment</h3> <br/>  <br/>
     <h2 style={{color:"white"}}>Today you can make appointment for this post other wise the appointment will be filled up :D</h2> <br/>  <br/>
     <p style={{color:"white"}}>Lorem ipsum dolor sit amet consectetur adipisicing elit. Non quaerat, libero aut eum pariatur vitae.</p>
     <Button style={{backgroundColor:"#1cc7c1"}}>Learn more</Button>

</div>

</div>
     </div>
    );
};

export default Doctor;
